import { Box, Flex, Text, Link } from 'shadcn'; // Menggunakan komponen dari ShadCN

const Footer = () => {
  return (
    <Box as="footer" bg="gray.800" color="white" py={6}>
      <Flex direction="column" align="center">
        <Text>&copy; 2024 Bella Cucina. All rights reserved.</Text>
        <Flex gap={4} mt={4}>
          <Link href="#" color="white">Privacy Policy</Link>
          <Link href="#" color="white">Terms of Service</Link>
        </Flex>
      </Flex>
    </Box>
  );
};

export default Footer;
